import { useRef, useEffect } from "react";

//comps
import MessageDefaultRedirect from "../comps/MessageDefaultRedirect";

export default function PostRegistrationPage(){

    const mainRect = useRef(null);

    useEffect(() => {
        mainRect.current.style.marginLeft = `-${mainRect.current.offsetWidth/2}px`;
        mainRect.current.style.marginTop = `-${mainRect.current.offsetHeight/2}px`;
    });


    return (
        <div ref={mainRect}>
            <MessageDefaultRedirect message="Thank you for your registration" />
        </div>
    );
}
